An important discussion with host Kelly Kinkaid and Native Son creator Emil Wilbekin happened during the SiriusXM Urbanview Town Hall entitled, “Supporting Our Brothers”. The informative panel of guests consisted of ViiV Healthcare’s Marc Meachem, Bishop Joseph Tolton and journalist and activist Kenyon Farrow.  The HIV/AIDS statistics of Black gay Men are steadily rising.  What are WE going to do? This discussion was created to educate, acknowledge and bring more awareness to the masses.  Help spread the word and share.

